    title: ''
  })
  setOptions({title: 'asdgsa'})
  console.log(options)
  return (
    <div>
      <Drag sizeOptions={['small', 'middle', 'great', 'relax', 'giant']} title="报名更新资料审批待办">
        
      </Drag>
    </div>
  );
}
